  issue_date    DATE not null,
  clearing_date DATE not null,
  account_id    INTEGER not null
)
tablespace SYSTEM
  pctfree 10
  pctused 40
  initrans 1
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );
alter table CHECKS
  add primary key (CHECK_ID)
  using index 
  tablespace SYSTEM
  pctfree 10
  initrans 2
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );
alter table CHECKS
  add foreign key (ACCOUNT_ID)
  references ACCOUNTS (ACCOUNT_ID);

